import { Box, Typography, Grid, Button, Container } from '@mui/material'
import { useRouter } from 'next/router'
import NextLink from 'next/link'
import { subtitleStyle, title2Style, descriptionStyle, title3Style, buttonStyle } from '../../styles/defaultStyles'

export default function ThingsThatWeValue() {
  const { locale } = useRouter()
  return (
    <Box sx={{ px: { xs: 2, sm: 3, md: 8 }, py: { xs: 2, sm: 4, md: 6 } }}>
      <Container>
        <Typography component="h3" sx={{ ...subtitleStyle, textAlign: 'center' }}>
          {locale === "ru" && "Что мы ценим?"}
          {locale === "en" && "What do we value?"}
        </Typography>
        <Typography component="h2" sx={{ ...title2Style, textAlign: 'center', mt: 3 }}>
          {locale === "ru" && "Надежность в основе"}
          {locale === "en" && "Reliability at the heart"}
        </Typography>
        <Typography sx={{ ...descriptionStyle, textAlign: 'center', mt: 4, maxWidth: 600, ml: 'auto', mr: 'auto' }}>
          {locale === "ru" && "Как удаленная команда независимых мыслителей, мы разделяем те же ценности, которые заставляют любые вещи работать"}
          {locale === "en" && "As a remote team of independent thinkers, we share the same values that make things work."}
        </Typography>

        <Box sx={{ py: 4 }}>
          <Grid container spacing={4}>
            <Grid item xs={12} sm={6}>
              <Box sx={{ height: 150 }}>
                <DoogieDoodle />
              </Box>
              <Typography component="h4" sx={{ ...title3Style, mt: 2 }}>
                {locale === "ru" && "Честность и открытость"}
                {locale === "en" && "Honesty and openness"}
              </Typography>
              <Typography sx={{ ...descriptionStyle, mt: 2 }}>
                {locale === "ru" && "Мы честно общаемся друг с другом, даже если правда нарушает чьё-либо эго. Мы считаем, что в долгосрочной перспективе только благодаря хорошему и честному общению друг с другом мы сможем создать дополнительную ценность для наших клиентов."}
                {locale === "en" && "We communicate honestly with each other, even if the truth violates someone's ego. We believe that in the long term, it is only through good and honest communication with each other that we can create added value for our customers."}
              </Typography>
            </Grid>

            <Grid item xs={12} sm={6}>
              <Box sx={{ height: 150 }}>
                <RollerSkatingDoodle />
              </Box>
              <Typography component="h4" sx={{ ...title3Style, mt: 2 }}>
                {locale === "ru" && "Прозрачность"}
                {locale === "en" && "Transparency"}
              </Typography>
              <Typography sx={{ ...descriptionStyle, mt: 2 }}>
                {locale === "ru" && "В нашем случае прозрачность означает, что мнение каждого открыто для обсуждения любым членом команды. Вот почему для нас так важно держать свой мозг открытым и относиться к каждому отзыву со смирением, возможностью взглянуть на вещи с другой точки зрения и как возможность улучшить свои навыки."}
                {locale === "en" && "In our case, transparency means that everyone's opinion is open to discussion by any member of the team. This is why it is so important for us to keep our brains open and to treat each review with humility, the opportunity to look at things from a different perspective and as an opportunity to improve our skills."}
              </Typography>
            </Grid>

            <Grid item xs={12} sm={6}>
              <Box sx={{ height: 150 }}>
                <PlantDoodle />
              </Box>
              <Typography component="h4" sx={{ ...title3Style, mt: 2 }}>
                {locale === "ru" && "Обязательства и ответственность"}
                {locale === "en" && "Obligations and responsibilities"}
              </Typography>
              <Typography sx={{ ...descriptionStyle, mt: 2 }}>
                {locale === "ru" && "Удаленная работа дает большие возможности, но сопряжена с большой ответственностью. В PXSTUDIO каждый член команды отвечает за определенную часть проекта, и именно он должен предоставить лучшее решение для него. Для нас важно, чтобы все было так, а проекты выполнялись как хорошо отлаженный механизм."}
                {locale === "en" && "Remote work offers great opportunities, but it comes with a lot of responsibility. At PXSTUDIO, each team member is responsible for a specific part of the project, and it is he who must provide the best solution for him. It is important for us that everything is like this, and the projects are carried out as a well-oiled mechanism."}
              </Typography>
            </Grid>

            <Grid item xs={12} sm={6}>
              <Box sx={{ height: 150 }}>
                <PettingDoodle />
              </Box>
              <Typography component="h4" sx={{ ...title3Style, mt: 2 }}>
                {locale === "ru" && "Сопережевание и бескорыстие"}
                {locale === "en" && "Empathy and unselfishness"}
              </Typography>
              <Typography sx={{ ...descriptionStyle, mt: 2 }}>
                {locale === "ru" && "Это два очень важных фактора в PXSTUDIO. Мы считаем, что каждый человек заслуживает ценных отношений с другими людьми и приятной рабочей среды. Мы стараемся помогать друг другу и даем столько, сколько берем сами."}
                {locale === "en" && "These are two very important factors in PXSTUDIO. We believe that everyone deserves valuable relationships with others and a pleasant work environment. We try to help each other and give as much as we take ourselves."}
              </Typography>
            </Grid>
          </Grid>
        </Box>

        <Box sx={{ py: 4 }}>
          <Box sx={{ maxWidth: 600, ml: 'auto', mr: 'auto', fontFamily: "Noto Serif", border: '2px dashed #ff6161', borderRadius: "30px", p: 3, fontSize: 16, textAlign: 'center' }}>
            {locale === "ru" && "Для нас клиенты действительно стоят на первом месте, потому что мы помогаем им не только развивать свой бизнес, но и учим их понимать технологию, стоящую за этим."}
            {locale === "en" && "For us, customers really come first, because we help them not only grow their business, but also teach them to understand the technology behind it."}
          </Box>
        </Box>

        <Box sx={{ py: 4, textAlign: 'center' }}>
          <NextLink href="/contacts" passHref>
            <Button color="primary" variant="contained" sx={{ ...buttonStyle }}>
              {locale === "ru" && "Работать с нами"}
              {locale === "en" && "Work with us"}
            </Button>
          </NextLink>
        </Box>
      </Container>
    </Box>
  )
}

